pragma solidity ^0.8.0;

import "../ERC725/IERC725Y.sol";

contract ERC725YWriter {

    function CallSetData(address to, bytes32[] calldata _keys, bytes[] calldata _values)
        public
    {
        IERC725Y(to).setData(_keys, _values);
    }

}
